import GenericServices from "./GenericServices";

class UserManagementService extends GenericServices {
  constructor() {
    super();
  }
  addUser = (data) => this.post("rUser", data);
  deleteUser = (_id) => this.delete("rUser/" + _id);
  updateUser = (_id, data) => this.put("rUser/" + _id, data);
  getUsers = () => this.get("rUser");
  getSingleUser = (id) => this.get("rUser/" + id);
}

let UserManagementServices = new UserManagementService();
export default UserManagementServices;
